(398, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:99:\"How to Streamline Your Freelance Business Processes — Takeaways From Our Webinar With Paul Jarvis\";s:7:\"excerpt\";s:217:\"Paul Jarvis, a web designer, podcaster, and author of \"Company of One\", provides illuminating insights on how to streamline your freelance business processes, with an in-depth explanation of why it\'s crucial to do so.\";s:7:\"created\";i:1597652002;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/webinar-paul-jarvis/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:34:\"How To Start A Web Design Business\";s:7:\"excerpt\";s:201:\"If you want to start a new website design business, or simply improve the one you already have, then follow this comprehensive guide and create a successful web design business that will run smoothly. \";s:7:\"created\";i:1597320704;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:125:\"https://elementor.com/blog/start-web-design-business/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:54:\"How to Create a Shrinking Sticky Header With Elementor\";s:7:\"excerpt\";s:184:\"In a new column, our employees share their knowledge, practices, and insights with you. This week, our Elementor expert explains how to create a shrinking sticky header with Elementor.\";s:7:\"created\";i:1597224099;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/shrinking-sticky-header/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:42:\"Elementor Sites of the Month – July 2020\";s:7:\"excerpt\";s:72:\"Here are our top picks of Elementor sites for July 2020. Check them out!\";s:7:\"created\";i:1597068415;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/blog/showcase-july-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:33:\"7 Rules for Website Color Schemes\";s:7:\"excerpt\";s:232:\"Colors are the first thing people notice when they visit your site, and your color scheme can make a huge impact on both style and consistency. Learn how to choose the right color palette, and work it into your site\'s design system.\";s:7:\"created\";i:1596790636;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/website-color-schemes/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
