(297, 66, '_elementor_data', '[{\"id\":\"26021961\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"7aadf651\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"601a1a49\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><!-- wp:heading {\\\"level\\\":4} --><\\/p>\\n<h5>Jeudi 30 octobre 2019,&nbsp;pour la premi\\u00e8re fois en Arabie saoudite,&nbsp;un match de catch f\\u00e9minin s\'est d\\u00e9roul\\u00e9, a annonc\\u00e9 la soci\\u00e9t\\u00e9 d\\u2019organisation am\\u00e9ricaine World Westling Entertainment (WWE).<\\/h5>\\n<p><!-- \\/wp:heading --><!-- wp:paragraph --><\\/p>\\n<p><img class=\\\"alignleft\\\" src=\\\"https:\\/\\/www.womensports.fr\\/wp-content\\/uploads\\/2019\\/10\\/match_catch_feminin.jpg\\\" srcset=\\\"https:\\/\\/www.womensports.fr\\/wp-content\\/uploads\\/2019\\/10\\/match_catch_feminin.jpg 759w, https:\\/\\/www.womensports.fr\\/wp-content\\/uploads\\/2019\\/10\\/match_catch_feminin-300x168.jpg 300w, https:\\/\\/www.womensports.fr\\/wp-content\\/uploads\\/2019\\/10\\/match_catch_feminin-434x244.jpg 434w, https:\\/\\/www.womensports.fr\\/wp-content\\/uploads\\/2019\\/10\\/match_catch_feminin-450x253.jpg 450w, https:\\/\\/www.womensports.fr\\/wp-content\\/uploads\\/2019\\/10\\/match_catch_feminin-400x225.jpg 400w\\\" alt=\\\"Le combat opposera les deux stars de la WWE : Natalya et Lacey Evans.\\\" width=\\\"217\\\" height=\\\"122\\\"><\\/p>\\n<p><!-- \\/wp:paragraph --><!-- wp:paragraph {\\\"textColor\\\":\\\"vivid-purple\\\"} --><\\/p>\\n<p class=\\\"has-text-color has-vivid-purple-color\\\">Le combat a oppos\\u00e9 les deux stars de la WWE :&nbsp;<span style=\\\"letter-spacing: 0px;\\\">Natalya et Lacey Evans.<\\/span><\\/p>\\n<p class=\\\"has-text-color has-vivid-purple-color\\\">\\n<\\/p><p class=\\\"has-text-color has-vivid-purple-color\\\">\\n<\\/p><p><!-- \\/wp:paragraph --><!-- wp:paragraph --><\\/p>\\n<p>Les deux stars de la WWE,&nbsp;Natalya&nbsp;et&nbsp;Lacey Evans, vont s\\u2019affronter au stade international du Roi-Fahd de Ryad dans le cadre du&nbsp;\\u00ab&nbsp;Crown Jewel&nbsp;\\u00bb. Cet \\u00e9v\\u00e9nement s\\u2019inscrit dans le cadre de \\u00ab Saison de Ryad \\u00bb, qui comprend une centaine d\\u2019\\u00e9v\\u00e9nements sportifs et de divertissements de classe mondiale, pendant plus de deux mois.<\\/p>\\n<p><!-- \\/wp:paragraph --><!-- wp:paragraph --><\\/p>\\n<p>Une grande avanc\\u00e9e pour l\\u2019Arabie saoudite qui tente d\\u2019am\\u00e9liorer son image de royaume ultra-conservateur.<\\/p>\\n<p><!-- \\/wp:paragraph --><\\/p>\",\"align\":\"left\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Helvetica\",\"typography_font_size\":{\"unit\":\"px\",\"size\":13,\"sizes\":[]},\"typography_font_weight\":\"normal\",\"typography_line_height\":{\"unit\":\"em\",\"size\":1.6,\"sizes\":[]},\"typography_letter_spacing\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"text_columns\":\"1\",\"column_gap\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
