(43, 1, '2020-08-10 18:03:14', '2020-08-10 16:03:14', '<!-- wp:paragraph -->\n<p>Quelques définitions pour mieux vous y retrouvez dans le monde du catch ! </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[42]} -->\n<figure class=\"wp-block-gallery columns-1 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-content/uploads/2020/08/catch2-1.jpg\" alt=\"\" data-id=\"42\" data-full-url=\"http://localhost/wp-content/uploads/2020/08/catch2-1.jpg\" data-link=\"http://localhost/?attachment_id=42\" class=\"wp-image-42\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p><em>\"Si tu vas à un show de catch, tu auras assis à ta gauche le spectateur plein de bière qui criera à qui veut bien l’entendre (toi, par définition qui n’as pas le choix) les préjugés sur ce sport\"</em>. </p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:nextpage -->\n<!--nextpage-->\n<!-- /wp:nextpage -->\n\n<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\"><strong>Définition :</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le <strong>catch</strong>, également appelé <strong>lutte professionnelle</strong> est une forme de <a href=\"https://fr.wikipedia.org/wiki/Divertissement\">divertissement</a> combinant performances <a href=\"https://fr.wikipedia.org/wiki/Sport\">sportives</a> et <a href=\"https://fr.wikipedia.org/wiki/Th%C3%A9%C3%A2tre\">théâtrales</a>. Dans sa forme moderne, le catch se présente comme une série de combats en public qui s\'enchaînent lors de réunions organisées par des compagnies itinérantes ou lors d\'enregistrements d\'émissions régulières télévisées. Chaque combat oppose catcheurs ou catcheuses sur un ring, reproduisant les codes des sports de combat tout en y intégrant des règles et conventions propres à la discipline et à ses spécificités régionales.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\"><strong>Étymologie</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le terme est un emprunt à l\'anglais car il est dérivé de l\'ancienne expression anglo-saxonne <em><strong>catch-as-catch-can</strong></em> (en français « attrape-le comme tu peux ») désignant une forme de lutte libre. En Amérique du Nord francophone, il est question de « lutte » ou « lutte professionnelle » et dans le langage familier, « catcher » signifie attraper ou comprendre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\"><strong>Différentes formes</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>le catch congolais, qui se pratique avec l\'aide de fétiches, très populaire à Brazzaville et Kinshasa ;</li><li>le catch hardcore (<em>hardcore wrestling</em>) ;</li><li>la lucha libre, pratiquée au Mexique ;</li><li>le puroresu, pratiqués au Japon ;</li><li>le shoot wrestling, pratiqué au Japon ;</li><li>le catch wrestling, pratiqué en Europe ;</li></ul>\n<!-- /wp:list -->', 'Le catch ? Définitions', '', 'inherit', 'closed', 'closed', '', '40-revision-v1', '', '', '2020-08-10 18:03:14', '2020-08-10 16:03:14', '', 40, 'http://localhost/2020/08/10/40-revision-v1/', 0, 'revision', '', 0),
(44, 1, '2020-08-10 18:07:00', '2020-08-10 16:07:00', '<!-- wp:paragraph -->\n<p>Quelques définitions pour mieux vous y retrouvez dans le monde du catch ! </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[42]} -->\n<figure class=\"wp-block-gallery columns-1 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-content/uploads/2020/08/catch2-1.jpg\" alt=\"\" data-id=\"42\" data-full-url=\"http://localhost/wp-content/uploads/2020/08/catch2-1.jpg\" data-link=\"http://localhost/?attachment_id=42\" class=\"wp-image-42\"/></figure></li></ul></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p><em>\"Si tu vas à un show de catch, tu auras assis à ta gauche le spectateur plein de bière qui criera à qui veut bien l’entendre (toi, par définition qui n’as pas le choix) les préjugés sur ce sport\"</em>.&nbsp;</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:nextpage -->\n<!--nextpage-->\n<!-- /wp:nextpage -->\n\n<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\"><strong>Définition :</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le&nbsp;<strong>catch</strong>, également appelé&nbsp;<strong>lutte professionnelle</strong> est une forme de&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Divertissement\">divertissement</a>&nbsp;combinant performances&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Sport\">sportives</a>&nbsp;et&nbsp;<a href=\"https://fr.wikipedia.org/wiki/Th%C3%A9%C3%A2tre\">théâtrales</a>. Dans sa forme moderne, le catch se présente comme une série de combats en public qui s\'enchaînent lors de réunions organisées par des compagnies itinérantes ou lors d\'enregistrements d\'émissions régulières télévisées. Chaque combat oppose catcheurs ou catcheuses sur un ring, reproduisant les codes des&nbsp;sports de combat&nbsp;tout en y intégrant des règles et conventions propres à la discipline et à ses spécificités régionales.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\"><strong>Étymologie</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le terme est un emprunt à l\'anglais car il est dérivé de l\'ancienne expression anglo-saxonne&nbsp;<em><strong>catch-as-catch-can</strong></em>&nbsp;(en français «&nbsp;attrape-le comme tu peux&nbsp;») désignant une forme de lutte libre. En&nbsp;Amérique du Nord&nbsp;francophone, il est question de «&nbsp;lutte&nbsp;» ou «&nbsp;lutte professionnelle&nbsp;»&nbsp;et dans le langage familier, «&nbsp;catcher&nbsp;» signifie attraper ou comprendre.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\"><strong>Différentes formes</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>le&nbsp;catch congolais, qui se pratique avec l\'aide de fétiches, très populaire à&nbsp;Brazzaville&nbsp;et&nbsp;Kinshasa&nbsp;;</li><li>le&nbsp;catch hardcore&nbsp;(<em>hardcore wrestling</em>)&nbsp;;</li><li>la&nbsp;lucha libre, pratiquée au&nbsp;Mexique&nbsp;;</li><li>le&nbsp;puroresu, pratiqués au Japon&nbsp;;</li><li>le&nbsp;shoot wrestling, pratiqué au Japon&nbsp;;</li><li>le&nbsp;catch wrestling, pratiqué en Europe&nbsp;;</li></ul>\n<!-- /wp:list -->', 'Le catch ? Définitions', '', 'inherit', 'closed', 'closed', '', '40-revision-v1', '', '', '2020-08-10 18:07:00', '2020-08-10 16:07:00', '', 40, 'http://localhost/2020/08/10/40-revision-v1/', 0, 'revision', '', 0),
