(49, 1, '2020-08-10 18:23:23', '2020-08-10 16:23:23', '<!-- wp:quote {\"className\":\"is-style-large\"} -->\n<blockquote class=\"wp-block-quote is-style-large\"><p>Le catch féminin, ça vient d\'où et depuis quand?</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"vivid-purple\"} -->\n<h2 class=\"has-vivid-purple-color has-text-color\">Origines</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>À l\'origine, les catcheuses sont mises en scène aux côtés de vaches à deux têtes et de chèvres à quatre cornes: elles sont l\'attraction phare des freak shows, ces carnavals très populaires aux États-Unis entre le milieu du XIXe siècle et celui du XXe. Leur parcours débute donc sous les railleries et l\'incrédulité du public.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">Pour beaucoup de spécialistes, c\'est <strong>Josephine Blatt</strong>, lutteuse et strongwoman, qui fait office de première catcheuse historique, en incarnant le personnage de Minerva. Blatt fait le choix d\'abandonner un sport légitime, la lutte, pour ouvrir les portes du catch, strictement interdit aux femmes par de nombreuses associations sportives aux États-Unis. Elle deviendra la première championne du monde de la discipline, avant de perdre le titre face à sa contemporaine Alice Williams</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"align\":\"center\",\"id\":\"52\",\"width\":280,\"height\":427,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter size-large is-resized\"><img src=\"http://localhost/wp-content/uploads/2020/08/josephineblatt-policegazette.jpg\" alt=\"\" class=\"wp-image-52\" width=\"280\" height=\"427\"/><figcaption>Joséphine Blatt, pionnière du catch féminin</figcaption></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dès le départ, le catch est pratiqué par les femmes à huis clos. De cette mise sous silence sexiste découle une invisibilisation, toujours d\'actualité, des catcheuses et de leur influence dans l\'industrie du catch contemporain.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"vivid-purple\"} -->\n<h2 class=\"has-vivid-purple-color has-text-color\"><strong>Début de reconnaissance</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Avec le désamour pour les freak shows, l\'héritage laissé par Josephine Blatt prend profondément racine aux États-Unis. Les spectacles de catch féminin ont plus souvent lieu dans des espaces officiels, comme des théâtres et des music-halls.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>&nbsp;S\'ils n\'ont ni la grandeur, ni le prestige accordé aux matchs masculins, ces performances sont légitimées par divers promoteurs, qui voient dans ce sport d\'outsider un vrai gagne-pain, permettant par la même occasion de légaliser le catch pour les deux genres.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote {\"className\":\"is-style-default\"} -->\n<blockquote class=\"wp-block-quote is-style-default\"><p><em><strong><span class=\"has-inline-color has-vivid-green-cyan-color\">«L\'égalité, c\'est faire des hommes et des femmes la principale attraction d\'un événement de catch. L\'équité permet à ces matchs de durer la même durée»&nbsp;</span></strong></em></p><cite>Alyssa Capri</cite></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Malheureusement, aucune catcheuse n\'est réellement visible avant 1930. C\'est la bataille historique qui se déroule depuis un siècle: briser cette invisibilisation».</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Après 1930, le catch féminin est marqué par une nouvelle figure de proue, Mildred Burke. En 1944, elle défend son titre de championne du monde face à un public de 12.000 personnes à Mexico City.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[53,54]} -->\n<figure class=\"wp-block-gallery columns-2 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-content/uploads/2020/08/Mildred_Burke_bio-1804efb1d4a1b60d71bab6ef30aebf20-1024x576.jpg\" alt=\"\" data-id=\"53\" data-full-url=\"http://localhost/wp-content/uploads/2020/08/Mildred_Burke_bio-1804efb1d4a1b60d71bab6ef30aebf20.jpg\" data-link=\"http://localhost/?attachment_id=53\" class=\"wp-image-53\"/></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-content/uploads/2020/08/MildredBurke.jpg\" alt=\"\" data-id=\"54\" data-full-url=\"http://localhost/wp-content/uploads/2020/08/MildredBurke.jpg\" data-link=\"http://localhost/?attachment_id=54\" class=\"wp-image-54\"/></figure></li></ul><figcaption class=\"blocks-gallery-caption\">Mildred Burke</figcaption></figure>\n<!-- /wp:gallery -->\n\n<!-- wp:paragraph -->\n<p>En parallèle de la vague WWE, les fédérations indépendantes entièrement féminines se multiplient, parmi lesquelles GLOW, qui a inspiré la série Netflix du même nom, puis SHIMMER. Leur audience est plus réduite, mais ce sont bien elles qui impulsent les évolutions du catch en inspirant la WWE.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"textColor\":\"vivid-purple\"} -->\n<h2 class=\"has-vivid-purple-color has-text-color\">Le féminisme en action</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>En un siècle, l\'arrivée des femmes dans un sport de lutte conçu selon des normes masculines a hissé le catch au rang de catalyseur de représentations féminines.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:gallery {\"ids\":[59]} -->\n<figure class=\"wp-block-gallery columns-1 is-cropped\"><ul class=\"blocks-gallery-grid\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wp-content/uploads/2020/08/catch_feminin_histoire-1-1024x505.jpg\" alt=\"\" data-id=\"59\" data-full-url=\"http://localhost/wp-content/uploads/2020/08/catch_feminin_histoire-1.jpg\" data-link=\"http://localhost/?attachment_id=59\" class=\"wp-image-59\"/></figure></li></ul><figcaption class=\"blocks-gallery-caption\">WWE Wrestling</figcaption></figure>\n<!-- /wp:gallery -->', 'Origines et historique du catch féminin', '', 'publish', 'closed', 'closed', '', 'origines-et-historique-du-catch-feminin', '', '', '2020-08-10 18:26:45', '2020-08-10 16:26:45', '', 23, 'http://localhost/?page_id=49', 2, 'page', '', 0),
