(66, 1, '2020-08-19 19:25:06', '2020-08-19 17:25:06', '\n\n<!-- wp:heading {\"level\":5} -->\n<h5>Jeudi 30 octobre 2019,&nbsp;pour la première fois en Arabie saoudite,&nbsp;un match de catch féminin s\'est déroulé, a annoncé la société d’organisation américaine World Westling Entertainment (WWE).</h5>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"align\":\"center\",\"width\":309,\"height\":173} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter is-resized\"><img src=\"https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin.jpg\" alt=\"Le combat opposera les deux stars de la WWE : Natalya et Lacey Evans.\" width=\"309\" height=\"173\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Le combat a opposé les deux stars de la WWE :&nbsp;Natalya et Lacey Evans.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les deux stars de la WWE,&nbsp;Natalya&nbsp;et&nbsp;Lacey Evans, vont s’affronter au stade international du Roi-Fahd de Ryad dans le cadre du&nbsp;«&nbsp;Crown Jewel&nbsp;». Cet événement s’inscrit dans le cadre de « Saison de Ryad », qui comprend une centaine d’événements sportifs et de divertissements de classe mondiale, pendant plus de deux mois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une grande avancée pour l’Arabie saoudite qui tente d’améliorer son image de royaume ultra-conservateur.</p>\n<!-- /wp:paragraph -->\n\n<p></p>', 'Historique : un match de catch féminin en Arabie saoudite !', 'Les deux stars de la WWE, Natalya et Lacey Evans, vont s’affronter au stade international du Roi-Fahd de Ryad dans le cadre du « Crown Jewel ». Cet événement s’inscrit dans le cadre de « Saison de Ryad »', 'publish', 'open', 'open', '', 'historique-un-match-de-catch-feminin-en-arabie-saoudite', '', '', '2020-08-19 20:17:45', '2020-08-19 18:17:45', '', 0, 'http://localhost/?p=66', 0, 'post', '', 0),
