(68, 1, '2020-08-10 18:32:59', '2020-08-10 16:32:59', '<!-- wp:heading {\"level\":4} -->\n<h4>Jeudi 30 octobre 2019, pour la première fois en Arabie saoudite, un match de catch féminin s\'est déroulé, a annoncé la société d’organisation américaine World Westling Entertainment (WWE).</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><img src=\"https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin.jpg\" alt=\"Le combat opposera les deux stars de la WWE : Natalya et Lacey Evans.\" width=\"759\" height=\"426\" srcset=\"https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin.jpg 759w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-300x168.jpg 300w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-434x244.jpg 434w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-450x253.jpg 450w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-400x225.jpg 400w\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"vivid-purple\"} -->\n<p class=\"has-text-color has-vivid-purple-color\">Le combat a opposé les deux stars de la WWE : Natalya et Lacey Evans.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les deux stars de la WWE,&nbsp;<strong>Natalya</strong>&nbsp;et&nbsp;<strong>Lacey Evans</strong>, vont s’affronter au stade international du Roi-Fahd de Ryad dans le cadre du&nbsp;«&nbsp;Crown Jewel&nbsp;». Cet événement s’inscrit dans le cadre de « Saison de Ryad », qui comprend une centaine d’événements sportifs et de divertissements de classe mondiale, pendant plus de deux mois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une grande avancée pour l’Arabie saoudite qui tente d’améliorer son image de royaume ultra-conservateur.</p>\n<!-- /wp:paragraph -->', 'Historique : un match de catch féminin en Arabie saoudite !', '', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2020-08-10 18:32:59', '2020-08-10 16:32:59', '', 66, 'http://localhost/2020/08/10/66-revision-v1/', 0, 'revision', '', 0),
(69, 1, '2020-08-19 19:25:06', '2020-08-19 17:25:06', '<!-- wp:heading {\"level\":4} -->\n<h4>Un temps passé de mode, le catch fait son grand retour en France. Le sport renoue même avec le professionnalisme chez les hommes... et chez les femmes.</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>On les surnommait L\'Ange Blanc, Le Bourreau de Béthune ou Popoff le Gitan, le roi de la manchette, et chaque soir ou presque, les spectateurs venaient par centaines les acclamer. A Paris, pas moins de sept scènes les programmaient plusieurs fois par semaine, dont la salle Wagram et l\'Elysée Montmartre, temple de la discipline. C\'est en direct de ces enceintes que Roger Couderc commentait leurs combats lors des retransmissions du vendredi soir sur l\'antenne de l\'ORTF. Eux ? Ce sont les catcheurs, idoles des foules après-guerre et dont certains feraient ensuite carrière au cinéma, comme André le Géant ou, surtout, Lino Ventura. Tombé ensuite en désuétude, le catch n\'était plus pratiqué en France que par quelques nostalgiques dans la solitude de salles miteuses et désertées par le public.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"vivid-purple\"} -->\n<h3 class=\"has-vivid-purple-color has-text-color\"><strong>Le revival masqué</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Mais depuis la fin des années 2000, le catch connaît un étonnant revival dans notre pays, porté par le retour de hype de ces combats aux Etats-Unis. Là-bas, loin de l\'image un peu ringarde dont il souffre parfois ici, ce sport est même plutôt tendance depuis que Hulk Hogan (<em>Rocky 3</em>) ou Dwayne Johnson, alias The Rock (<em>Le Retour de la momie</em>, et plus récemment&nbsp;<em>Hercules</em>, San Andreas) sont devenus des acteurs-catcheurs stars à Hollywood. Mais c\'est lorsque George Clooney a jeté son dévolu sur Stacy Keibler, en 2011, que le catch a définitivement investi les pages people des magazines : l\'actrice, apparue notamment dans la série&nbsp;<em>How I Met Your Mother</em>, s\'était fait connaître en combattant sous le nom de Nitro Girl quelques années plus tôt. Porté par sa bonne étoile américaine, le catch a tellement bien réussi son come-back en France que l\'on y trouve de nouveau des pratiquants professionnels, tels que Hugo Perez (El Guerriero) ou Ivan le Terrible.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"vivid-purple\"} -->\n<h3 class=\"has-vivid-purple-color has-text-color\"><strong>Et des filles sur le ring...</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Les filles ne sont pas en reste ; une dizaine d\'entre elles sont en partie ou totalement professionnelles, à l\'image de Pauline Laout et Morgane Leigh. La première, 21 ans, surnommée French Beauty, est une \"<em>face</em>\", une gentille ; la seconde, 23 ans, championne d\'Europe, est une \"<em>heel</em>\", une méchante, pour les besoins d\'une scénarisation dont raffolent les centaines de spectateurs qui les acclament à chaque gala - on atteint parfois même le millier, selon les salles. \"<em>Je n\'ai pas beaucoup de patience et je peux paraître un peu froide, alors je n\'ai pas trop de mal à passer pour la méchante</em>, savoure Morgane.&nbsp;<em>D\'autant que je sais très bien qu\'amener le public à prendre parti est une manière de le faire participer, c\'est le jeu. Et puis ça n\'empêche pas certains spectateurs de s\'attacher à mon personnage. J\'entends souvent des gens me dire :</em>&nbsp;\"Même si tu es méchante, tu es la meilleure\".\" Avec du recul le plus souvent, parfois au premier degré, comme ce fan qui, à chaque gala, envoie des bouquets de fleurs aux unes et tente de soudoyer les organisateurs pour faire perdre les autres. Ennemies sur le ring, les deux catcheuses sont amies à la ville. Et, loin de l\'image d\'amazones histrioniques qu\'elles incarnent à l\'occasion, sont à la fois gracieuses et courtoises à la ville.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":3,\"textColor\":\"vivid-purple\"} -->\n<h3 class=\"has-vivid-purple-color has-text-color\"><strong>Une école de la vie</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>\"<em>Cela peut paraître paradoxal, mais c\'est précisément le catch qui m\'a amenée à devenir beaucoup plus féminine</em>, se souvient Morgane.&nbsp;<em>Le fait que nos costumes reprennent des codes très \"</em>girly<em>\", jusqu\'à l\'outrance parfois, m\'a fait assumer un aspect de ma personnalité que je cachais jusque-là sous une apparence de garçon manqué.</em>\" Commerciale dans l\'automobile, la Bretonne se consacre au catch depuis quelques mois, disputant en moyenne \"deux galas par mois\". Pauline, elle, prépare un diplôme pour ouvrir une salle de sport. Du haut de ses 1,57 m, la jeune femme qui vit et s\'entraîne dans l\'Aube a parfois du mal à convaincre ses interlocuteurs qu\'elle gagne en partie sa vie grâce au catch. \"Ils n\'en reviennent pas, s\'amuse-t-elle. Mais pour moi, ce n\'est pas qu\'un simple travail : c\'est une école de vie, qui m\'a appris à m\'affirmer, à respecter les autres. Au catch, on frappe, mais on a un impératif : ne jamais blesser, ce qui veut dire être très attentif à l\'adversaire.\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\"><strong>\"On a une date de péremption\"</strong></h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>C\'est aussi le catch qui fait voyager les jeunes femmes : Italie, Espagne, Angleterre, Allemagne et même Japon, les galas sont internationaux et leur permettent de découvrir des cultures très diverses. \"<em>C\'est une grande richesse, même si c\'est épuisant, avoue Morgane. Les voyages de huit heures à cinq dans une voiture, les événements de famille que l\'on manque... Forcément, cela pèse un peu et l\'on se dit qu\'on n\'arrêtera sans doute pas trop tard notre carrière</em>\", anticipe-t-elle. \"<em>On a de toute façon une date de péremption</em>, sourit Pauline,&nbsp;<em>les hommes peuvent catcher jusqu\'à 60 ans, mais nous, si on veut fonder une famille, il faut songer vers 35 ans à arrêter de prendre des coups.</em>\" Prendre des coups ? C\'est loin d\'être une expression. \"<em>Nos galas, ce ne sont pas des shows à l\'américaine. Les coups que l\'on porte sont réels, et j\'invite tous ceux qui en doutent à venir assister à l\'un de nos combats pour s\'en convaincre</em>\", propose Pauline. La démonstration par l\'exemple, dans la moiteur caniculaire d\'une salle de sport de Nanterre (Hauts-de-Seine), mi-juillet, fut plus que convaincante; affûtées&nbsp;comme des arbalètes, ce sont deux sportives de très haut niveau qui, ce jour-là, se sont fait face à l\'entraînement. Confirmant une impression tangible : avec des personnalités aussi attachantes, doublées d\'athlètes capables de s\'entraîner cinq fois par semaine et de combattre pendant des heures, le catch féminin a probablement de belles heures devant lui.</p>\n<!-- /wp:paragraph -->', 'Le grand retour du catch… féminin !', '', 'publish', 'open', 'open', '', 'le-grand-retour-du-catch-feminin', '', '', '2020-08-19 19:25:06', '2020-08-19 17:25:06', '', 0, 'http://localhost/?p=69', 0, 'post', '', 0),
