(76, 1, '2020-08-19 19:25:06', '2020-08-19 17:25:06', '<!-- wp:heading {\"level\":4,\"textColor\":\"vivid-purple\"} -->\n<h4 class=\"has-vivid-purple-color has-text-color\">Les lutteuses sont en train d’opérer une véritable révolution féminine dans le monde du catch</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>«&nbsp;BECKY&nbsp;!&nbsp;BECKY&nbsp;!&nbsp;BECKY&nbsp;!&nbsp;», scandent les 80.000 spectateurs&nbsp;venus assister à&nbsp;<a href=\"https://www.20minutes.fr/culture/2045867-20170407-wrestlemania-fait-courir-fans-catch\">Wrestlemania 35</a>, plus grand événement annuel dans le&nbsp;<a href=\"https://www.20minutes.fr/culture/2045107-20170407-catch-faux-combat-vraie-performance-artistique\">monde du catch</a>. La&nbsp;lutteuse irlandaise&nbsp;vient de remporter le «&nbsp;Main Event&nbsp;», autrement dit le combat le plus important et le plus attendu du show, et celui qui a l’honneur de finir la soirée. Au-delà de la victoire de la rouquine aux coups dévastateurs, le match est un évènement historique dans le sport-divertissement&nbsp;:&nbsp;pour la première fois, c’est un combat&nbsp;entre lutteuses qui a conclu Wrestlemania.&nbsp;Le paroxysme de&nbsp;<a href=\"https://www.20minutes.fr/dossier/feminisme\">la révolution féminine</a>&nbsp;opérée dans le catch, et qui sera encore à l’honneur ce mardi soir à l’AccorHotels Arena de Bercy pour un show de la&nbsp;<a href=\"https://www.wwe.com/\" target=\"_blank\" rel=\"noreferrer noopener\">WWE</a>&nbsp;(World Wrestling Entertainment), la plus grande fédération américaine de catch.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":77,\"width\":560,\"height\":315,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://localhost/wp-content/uploads/2020/08/ronda-rousey-retour-1024x576.jpg\" alt=\"\" class=\"wp-image-77\" width=\"560\" height=\"315\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Il y a encore quelques années, imaginer les femmes squatter le haut de l’affiche de cette compagnie relevait de la fantaisie. Les combats féminins étaient plus vus comme la pause de la soirée, lorsqu’on allait chercher sa bière au frigo ou qu’on filait aux toilettes. Des combats mous, peu enivrants et aux enjeux assez faiblards, voire carrément ubuesques, style « La gagnante aura le droit de poser pour <a href=\"https://www.20minutes.fr/dossier/playboy\">Playboy</a> » (et oui, c’est dur à assumer en tant que fan de catch, mais cette période a bel et bien existé).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depuis, Becky Lynch et consort se sont imposées à la WWE et leurs combats sont autant – si ce n’est plus – appréciés que ceux de leurs homologues XY.&nbsp;Alors, pourquoi un tel virage a été réalisé&nbsp;?&nbsp;On est allé enquêter auprès de Philippe Chereau et Christophe Agius, commentateur de catch sur AB1 et madeleine de Proust pour tout adolescent des années 2000 ayant connu&nbsp;<a href=\"https://www.youtube.com/watch?v=dKagEGavjZM\" target=\"_blank\" rel=\"noreferrer noopener\">les soirées Raw et Smackdown</a>. De suite, Philippe Chereau nous livre une première explication&nbsp;:&nbsp;«&nbsp;L’ambition de la WWE, c’est de devenir le Disney du catch, un produit pour toute la famille, afin de maximiser les revenus. Tu ne peux donc pas ignorer la fille, la mère, la grand-mère dans ton public, il leur faut à elles aussi des héroïnes à qui s’identifier, qui soient aussi intéressantes et captivantes que les hommes.&nbsp;»</p>\n<!-- /wp:paragraph -->', 'WWE: Comment le catch a-t-il effectué sa révolution féminine grâce aux lutteuses?', '', 'publish', 'open', 'open', '', 'wwe-comment-le-catch-a-t-il-effectue-sa-revolution-feminine-grace-aux-lutteuses', '', '', '2020-08-19 19:25:06', '2020-08-19 17:25:06', '', 0, 'http://localhost/?p=76', 0, 'post', '', 0),
