(86, 1, '2020-08-19 19:42:02', '2020-08-19 17:42:02', '<!-- wp:media-text {\"mediaId\":67,\"mediaLink\":\"http://localhost/2020/08/19/historique-un-match-de-catch-feminin-en-arabie-saoudite/natalya_catch/\",\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/wp-content/uploads/2020/08/natalya_catch.jpg\" alt=\"\" class=\"wp-image-67\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:heading {\"level\":4} -->\n<h4>Un temps passé de mode, le catch fait son grand retour en France. Le sport renoue même avec le professionnalisme chez les hommes… et chez les femmes.</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>On les surnommait L’Ange Blanc, Le Bourreau de Béthune ou Popoff le Gitan, le roi de la manchette, et chaque soir ou presque, les spectateurs venaient par centaines les acclamer. A Paris, pas moins de sept scènes les programmaient plusieurs fois par semaine, dont la salle Wagram et l’Elysée Montmartre, temple de la discipline. C’est en direct de ces enceintes que Roger Couderc commentait leurs combats lors des retransmissions du vendredi soir sur l’antenne de l’ORTF. Eux ? Ce sont les catcheurs, idoles des foules après-guerre et dont certains feraient ensuite carrière au cinéma, comme André le Géant ou, surtout, Lino Ventura. Tombé ensuite en désuétude, le catch n’était plus pratiqué en France que par quelques nostalgiques dans la solitude de salles miteuses et désertées par le public.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:media-text -->', 'Actualités', '', 'inherit', 'closed', 'closed', '', '21-autosave-v1', '', '', '2020-08-19 19:42:02', '2020-08-19 17:42:02', '', 21, 'http://localhost/2020/08/19/21-autosave-v1/', 0, 'revision', '', 0),
(89, 1, '2020-08-19 19:42:48', '2020-08-19 17:42:48', '<!-- wp:heading {\"level\":4} -->\n<h4>Jeudi 30 octobre 2019,&nbsp;pour la première fois en Arabie saoudite,&nbsp;un match de catch féminin s\'est déroulé, a annoncé la société d’organisation américaine World Westling Entertainment (WWE).</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><img src=\"https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin.jpg\" alt=\"Le combat opposera les deux stars de la WWE : Natalya et Lacey Evans.\" width=\"759\" height=\"426\" srcset=\"https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin.jpg 759w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-300x168.jpg 300w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-434x244.jpg 434w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-450x253.jpg 450w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-400x225.jpg 400w\"></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"vivid-purple\"} -->\n<p class=\"has-text-color has-vivid-purple-color\">Le combat a opposé les deux stars de la WWE : Natalya et Lacey Evans.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les deux stars de la WWE,&nbsp;<strong>Natalya</strong>&nbsp;et&nbsp;<strong>Lacey Evans</strong>, vont s’affronter au stade international du Roi-Fahd de Ryad dans le cadre du&nbsp;«&nbsp;Crown Jewel&nbsp;». Cet événement s’inscrit dans le cadre de « Saison de Ryad », qui comprend une centaine d’événements sportifs et de divertissements de classe mondiale, pendant plus de deux mois.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Une grande avancée pour l’Arabie saoudite qui tente d’améliorer son image de royaume ultra-conservateur.</p>\n<!-- /wp:paragraph -->', 'Historique : un match de catch féminin en Arabie saoudite !', 'Les deux stars de la WWE, Natalya et Lacey Evans, vont s’affronter au stade international du Roi-Fahd de Ryad dans le cadre du « Crown Jewel ». Cet événement s’inscrit dans le cadre de « Saison de Ryad »', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2020-08-19 19:42:48', '2020-08-19 17:42:48', '', 66, 'http://localhost/2020/08/19/66-revision-v1/', 0, 'revision', '', 0),
