 « Saison de Ryad »', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2020-08-19 20:09:45', '2020-08-19 18:09:45', '', 66, 'http://localhost/2020/08/19/66-revision-v1/', 0, 'revision', '', 0),
