(96, 1, '2020-08-19 20:15:22', '2020-08-19 18:15:22', '<p></p>\n\n<!-- wp:heading {\"level\":4} -->\n</p>\n<h5>Jeudi 30 octobre 2019,&nbsp;pour la première fois en Arabie saoudite,&nbsp;un match de catch féminin s\'est déroulé, a annoncé la société d’organisation américaine World Westling Entertainment (WWE).</h5>\n<p>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n</p>\n<p><img src=\"https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin.jpg\" srcset=\"https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin.jpg 759w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-300x168.jpg 300w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-434x244.jpg 434w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-450x253.jpg 450w, https://www.womensports.fr/wp-content/uploads/2019/10/match_catch_feminin-400x225.jpg 400w\" alt=\"Le combat opposera les deux stars de la WWE : Natalya et Lacey Evans.\" width=\"217\" height=\"122\"></p>\n<p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"vivid-purple\"} -->\n</p>\n<p>Le combat a opposé les deux stars de la WWE :&nbsp;Natalya et Lacey Evans.</p>\n<p>\n</p><p>\n</p><p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n</p>\n<p>Les deux stars de la WWE,&nbsp;Natalya&nbsp;et&nbsp;Lacey Evans, vont s’affronter au stade international du Roi-Fahd de Ryad dans le cadre du&nbsp;«&nbsp;Crown Jewel&nbsp;». Cet événement s’inscrit dans le cadre de « Saison de Ryad », qui comprend une centaine d’événements sportifs et de divertissements de classe mondiale, pendant plus de deux mois.</p>\n<p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n</p>\n<p>Une grande avancée pour l’Arabie saoudite qui tente d’améliorer son image de royaume ultra-conservateur.</p>\n<p>\n<!-- /wp:paragraph -->\n\n<p></p>', 'Historique : un match de catch féminin en Arabie saoudite !', 'Les deux stars de la WWE, Natalya et Lacey Evans, vont s’affronter au stade international du Roi-Fahd de Ryad dans le cadre du « Crown Jewel ». Cet événement s’inscrit dans le cadre de « Saison de Ryad »', 'inherit', 'closed', 'closed', '', '66-revision-v1', '', '', '2020-08-19 20:15:22', '2020-08-19 18:15:22', '', 66, 'http://localhost/2020/08/19/66-revision-v1/', 0, 'revision', '', 0),
